script: |
  super -f text -I q12678.spq | sort > q12678.out

inputs:
  - name: q12678.spq
    data: |
      SELECT DISTINCT + ( - COUNT ( * ) ) FROM tab1 (FORMAT parquet) AS cor0 CROSS JOIN tab0 (FORMAT parquet) AS cor1;
  - name: tab0
  - name: tab1

outputs:
  - name: q12678.out
    data: |
      -9
